import React from 'react'
import {
  ChakraProvider,
  Text,
  Box
} from '@chakra-ui/react'
import theme from './theme/theme'
import './App.css';
import Fonts from './lib/fonts';

function App() {
  return (
    <ChakraProvider theme={theme}>
      <Box w={500} h={100} bg='instagramColor'>
        <Text color='brightRead'>Hello World.</Text>
      </Box>
    </ChakraProvider>
  );
}

export default App;
